// 算出实际时长
const daliyprograssObj = (list) => {
    let prograssObj = {其他: 0};
    let totalHour = 0
    for (const obj of list) {
        let s = obj.studyContent
        let index = s.indexOf('-');
        totalHour += obj.hourDuration
        let key = s.slice(0, index).trim();// tf
        let time = obj.minuteDuration // 1-0
        if (index === -1) {
            prograssObj.其他 += time
            continue
        }
        if (key === '问题') {
            prograssObj[key] = s.slice(index + 1).trim()
            continue
        }
        if (key in prograssObj) {
            prograssObj[key] += time
        } else {
            prograssObj[key] = time
        }
    }
    return [prograssObj, totalHour.toFixed(1)]
}

const insertDailyReportInfo = (table) => {
    let [prograssObj, totalHour] = daliyprograssObj(table)
    let user = getLocalStorage('userInfo').split('-')[0]
    let date = moment().format('YYYY/MM/DD')
    let tr = `
    <h2>
        <span>${user} - ${totalHour} h</span>
        <span class="date">${date}</span>
    </h2>
   <table>
        <tr class="success">
            <td>事件</td>
            <td>投入</td>
            <td>目标</td>
            <td>完成率</td>
        </tr>`

    let dailyTodoList = getLocalStorage('dailyTodoList') || []

    for (const k in prograssObj) {
        if (k === '问题' || k === '其他') {
            continue
        }
        let notFind = true
        for (const todo of dailyTodoList) {
            if (todo.includes('-')) {
                let index = todo.indexOf('-');
                let key = todo.slice(0, index).trim();
                let goalTime = todo.slice(index+1).trim()
                goalTime = Number(goalTime)
                if (k === key) {
                    notFind = false
                    //  算百分比
                    let currentPrograss = prograssObj[k]
                    let [persent, styleWidth] = calPersent(currentPrograss, goalTime)
                    tr += `<tr>
                    <td class="td-time">${key}</td>
                    <td class="td-hour">${prograssObj[key]} min</td>
                    <td class="td-hour">${goalTime} min</td>
                    <td class="td-width">${persent}</td>
                </tr>`;
                }
            }
        }
        if (notFind) {
            tr += `<tr>
                <td class="td-time">${k}</td>
                <td class="td-hour">${prograssObj[k]} min</td>
                <td class="td-hour"></td>
                <td class="td-width"></td>
            </tr>`;
        }
    }

    if (prograssObj.其他) {
        tr += `<tr>
                    <td class="td-time">其他</td>
                    <td class="td-hour">${prograssObj.其他} min</td>
                    <td class="td-hour"></td>
                    <td class="td-width"></td>
                </tr>`;
    }
    tr += '</table>'

    if (prograssObj.问题) {
        tr += `<div class="problem">
                    <span>- 问题反思 -</span>
                    <span>${prograssObj.问题}</span>
                </div>`;
    }
    

    let div = e('.share-today-info')
    div.innerHTML = tr
}

const bindEventLoadedShareImage = () => {
    let image = e('#id-img-share')
    bindEvent(image, 'load', () => {
        let iconClose = e('#id-icon-close')
        let src = image.getAttribute('src')
        if (src === '') {
            return
        }
        setTimeout(() => {
            // removeLoadingAnimation()
            addClass(image, 'active')
            addClass(iconClose, 'active')
        }, 1500)
    })
}




